social_posts.post_text:
sf martini week is in full effect!! ❤️‍🔥🍸🫶 #ad

two more days to check out martini week hosted by @JuniperoGin to celebrate the iconic martini. fun fact: the martini was originally created to celebrate miners who struck gold! 🏆 matt and I had the best time at @wildhawksf and @nopasf, and there are so many more participating locations, like @thedoriansf and @mrdigbys!

@juniperogin is also partnering with @sfsisters to donate $2 from every signature Junipero martini sold throughout the week to support the LGBTQIA+ community 🌈 you won’t want to miss it! 🥂 #JuniperoStrikesGold #21+

